import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { Search, Filter, Eye, Heart, MapPin, Calendar, DollarSign, Car } from 'lucide-react';
import { useApp } from '../../context/AppContext.tsx';
import { Listing, Vehicle } from '../../types/index.ts';

export function ListingsView() {
  const { state } = useApp();
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedMake, setSelectedMake] = useState('');
  const [priceRange, setPriceRange] = useState({ min: '', max: '' });
  const [sortBy, setSortBy] = useState('newest');
  const [showFilters, setShowFilters] = useState(false);

  // Mock listings data - in real app this would come from API
  const [listings] = useState<Array<Listing & { vehicle: Vehicle; seller: { username: string; location: string } }>>([
    {
      id: '1',
      vehicleId: '1',
      sellerId: '1',
      title: '2020 Toyota Camry - Excellent Condition',
      description: 'Well-maintained family sedan with low mileage. Perfect for daily commuting.',
      price: 22500,
      problems: [],
      additionalFeatures: ['Backup Camera', 'Bluetooth', 'Cruise Control'],
      isActive: true,
      views: 45,
      createdAt: new Date().toISOString(),
      updatedAt: new Date().toISOString(),
      vehicle: {
        id: '1',
        ownerId: '1',
        make: 'Toyota',
        model: 'Camry',
        year: 2020,
        mileage: 25000,
        transmission: 'automatic',
        estimatedValue: 23000,
        images: [],
        createdAt: new Date().toISOString(),
        updatedAt: new Date().toISOString()
      },
      seller: {
        username: 'john_doe',
        location: 'Los Angeles, CA'
      }
    },
    {
      id: '2',
      vehicleId: '2',
      sellerId: '2',
      title: '2018 Honda Civic - Great Gas Mileage',
      description: 'Reliable compact car with excellent fuel economy. Recent maintenance completed.',
      price: 18900,
      problems: ['Minor paint scratch on rear bumper'],
      additionalFeatures: ['Apple CarPlay', 'Lane Assist', 'Automatic Emergency Braking'],
      isActive: true,
      views: 67,
      createdAt: new Date(Date.now() - 86400000).toISOString(),
      updatedAt: new Date(Date.now() - 86400000).toISOString(),
      vehicle: {
        id: '2',
        ownerId: '2',
        make: 'Honda',
        model: 'Civic',
        year: 2018,
        mileage: 42000,
        transmission: 'manual',
        estimatedValue: 19500,
        images: [],
        createdAt: new Date().toISOString(),
        updatedAt: new Date().toISOString()
      },
      seller: {
        username: 'sarah_m',
        location: 'San Diego, CA'
      }
    }
  ]);

  const filteredListings = listings.filter(listing => {
    const matchesSearch = listing.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         listing.vehicle.make.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         listing.vehicle.model.toLowerCase().includes(searchTerm.toLowerCase());
    
    const matchesMake = !selectedMake || listing.vehicle.make === selectedMake;
    
    const matchesPrice = (!priceRange.min || listing.price >= Number(priceRange.min)) &&
                        (!priceRange.max || listing.price <= Number(priceRange.max));
    
    return matchesSearch && matchesMake && matchesPrice;
  });

  const sortedListings = [...filteredListings].sort((a, b) => {
    switch (sortBy) {
      case 'price-low':
        return a.price - b.price;
      case 'price-high':
        return b.price - a.price;
      case 'mileage':
        return a.vehicle.mileage - b.vehicle.mileage;
      case 'year':
        return b.vehicle.year - a.vehicle.year;
      default: // newest
        return new Date(b.createdAt).getTime() - new Date(a.createdAt).getTime();
    }
  });

  const makes = Array.from(new Set(listings.map(l => l.vehicle.make))).sort();

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex items-center justify-between">
        <div>
          <h1 className="text-3xl font-bold text-primary-100">Vehicle Listings</h1>
          <p className="text-primary-300 mt-1">
            Browse and search through available vehicles
          </p>
        </div>
        <div className="text-right">
          <p className="text-2xl font-bold text-primary-100">{sortedListings.length}</p>
          <p className="text-sm text-primary-300">listings found</p>
        </div>
      </div>

      {/* Search and Filters */}
      <div className="glass-effect rounded-xl p-6">
        <div className="flex flex-col lg:flex-row gap-4">
          {/* Search Bar */}
          <div className="flex-1 relative">
            <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 w-5 h-5 text-primary-400" />
            <input
              type="text"
              placeholder="Search by make, model, or title..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="input-field pl-10"
            />
          </div>

          {/* Filter Toggle */}
          <motion.button
            whileTap={{ scale: 0.95 }}
            onClick={() => setShowFilters(!showFilters)}
            className={`btn-secondary flex items-center space-x-2 ${showFilters ? 'bg-primary-100/20' : ''}`}
          >
            <Filter className="w-5 h-5" />
            <span>Filters</span>
          </motion.button>
        </div>

        {/* Expanded Filters */}
        {showFilters && (
          <motion.div
            initial={{ opacity: 0, height: 0 }}
            animate={{ opacity: 1, height: 'auto' }}
            exit={{ opacity: 0, height: 0 }}
            className="mt-4 pt-4 border-t border-primary-700/30"
          >
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
              {/* Make Filter */}
              <div>
                <label className="block text-sm font-medium text-primary-300 mb-2">
                  Make
                </label>
                <select
                  value={selectedMake}
                  onChange={(e) => setSelectedMake(e.target.value)}
                  className="input-field"
                >
                  <option value="">All Makes</option>
                  {makes.map(make => (
                    <option key={make} value={make}>{make}</option>
                  ))}
                </select>
              </div>

              {/* Price Range */}
              <div>
                <label className="block text-sm font-medium text-primary-300 mb-2">
                  Min Price
                </label>
                <input
                  type="number"
                  placeholder="$0"
                  value={priceRange.min}
                  onChange={(e) => setPriceRange(prev => ({ ...prev, min: e.target.value }))}
                  className="input-field"
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-primary-300 mb-2">
                  Max Price
                </label>
                <input
                  type="number"
                  placeholder="No limit"
                  value={priceRange.max}
                  onChange={(e) => setPriceRange(prev => ({ ...prev, max: e.target.value }))}
                  className="input-field"
                />
              </div>

              {/* Sort By */}
              <div>
                <label className="block text-sm font-medium text-primary-300 mb-2">
                  Sort By
                </label>
                <select
                  value={sortBy}
                  onChange={(e) => setSortBy(e.target.value)}
                  className="input-field"
                >
                  <option value="newest">Newest First</option>
                  <option value="price-low">Price: Low to High</option>
                  <option value="price-high">Price: High to Low</option>
                  <option value="mileage">Lowest Mileage</option>
                  <option value="year">Newest Year</option>
                </select>
              </div>
            </div>
          </motion.div>
        )}
      </div>

      {/* Listings Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {sortedListings.map((listing, index) => (
          <motion.div
            key={listing.id}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: index * 0.1 }}
            className="glass-effect rounded-xl overflow-hidden hover:shadow-xl transition-all duration-300 cursor-pointer group"
          >
            {/* Image Placeholder */}
            <div className="h-48 bg-gradient-to-br from-primary-700 to-primary-800 flex items-center justify-center relative overflow-hidden">
              <Car className="w-16 h-16 text-primary-400" />
              <div className="absolute top-3 right-3 flex space-x-2">
                <div className="flex items-center space-x-1 bg-black/50 rounded-full px-2 py-1">
                  <Eye className="w-3 h-3 text-white" />
                  <span className="text-xs text-white">{listing.views}</span>
                </div>
              </div>
            </div>

            {/* Content */}
            <div className="p-6">
              <div className="flex items-start justify-between mb-3">
                <h3 className="font-bold text-lg text-primary-100 group-hover:text-primary-50 transition-colors">
                  {listing.vehicle.year} {listing.vehicle.make} {listing.vehicle.model}
                </h3>
                <button className="text-primary-400 hover:text-red-400 transition-colors">
                  <Heart className="w-5 h-5" />
                </button>
              </div>

              <p className="text-primary-300 text-sm mb-4 line-clamp-2">
                {listing.description}
              </p>

              {/* Vehicle Info */}
              <div className="grid grid-cols-2 gap-3 mb-4 text-sm">
                <div className="flex items-center space-x-2 text-primary-300">
                  <Calendar className="w-4 h-4" />
                  <span>{listing.vehicle.year}</span>
                </div>
                <div className="flex items-center space-x-2 text-primary-300">
                  <Car className="w-4 h-4" />
                  <span>{listing.vehicle.mileage.toLocaleString()} mi</span>
                </div>
              </div>

              {/* Features */}
              {listing.additionalFeatures.length > 0 && (
                <div className="mb-4">
                  <div className="flex flex-wrap gap-1">
                    {listing.additionalFeatures.slice(0, 3).map((feature, idx) => (
                      <span
                        key={idx}
                        className="text-xs bg-primary-100/10 text-primary-200 px-2 py-1 rounded-full"
                      >
                        {feature}
                      </span>
                    ))}
                    {listing.additionalFeatures.length > 3 && (
                      <span className="text-xs text-primary-400">
                        +{listing.additionalFeatures.length - 3} more
                      </span>
                    )}
                  </div>
                </div>
              )}

              {/* Problems */}
              {listing.problems.length > 0 && (
                <div className="mb-4">
                  <p className="text-xs text-yellow-400 mb-1">Known Issues:</p>
                  <div className="flex flex-wrap gap-1">
                    {listing.problems.slice(0, 2).map((problem, idx) => (
                      <span
                        key={idx}
                        className="text-xs bg-yellow-400/10 text-yellow-300 px-2 py-1 rounded-full"
                      >
                        {problem}
                      </span>
                    ))}
                  </div>
                </div>
              )}

              {/* Price and Seller */}
              <div className="flex items-center justify-between">
                <div className="flex items-center space-x-2">
                  <DollarSign className="w-5 h-5 text-green-400" />
                  <span className="text-2xl font-bold text-green-400">
                    ${listing.price.toLocaleString()}
                  </span>
                </div>
                <div className="text-right">
                  <p className="text-sm font-medium text-primary-200">{listing.seller.username}</p>
                  <div className="flex items-center space-x-1 text-xs text-primary-400">
                    <MapPin className="w-3 h-3" />
                    <span>{listing.seller.location}</span>
                  </div>
                </div>
              </div>
            </div>
          </motion.div>
        ))}
      </div>

      {/* Empty State */}
      {sortedListings.length === 0 && (
        <div className="text-center py-16">
          <Car className="w-16 h-16 text-primary-400 mx-auto mb-4" />
          <h3 className="text-xl font-bold text-primary-200 mb-2">No listings found</h3>
          <p className="text-primary-400">
            Try adjusting your search criteria or filters
          </p>
        </div>
      )}
    </div>
  );
}
